import React, { Component } from 'react';
import './CalculatePayForm.css';
import 'timepicker/jquery.timepicker.min.js';
import 'timepicker/jquery.timepicker.min.css';

class CalculatePayForm extends Component {

  initTimePicker(){
    $(document).ready(function(){
        $('input.timepicker').timepicker({});
    });
  }

  render() {
    return (
      <form onSubmit={this.calculatePay()} id="calcPayForm">
        <label>Start Time:
          <input type="datetime" id="startTimeTextBox" />
        </label>
        <br/>
        <br/>
        <label>Bed Time:
          <input type="datetime" id="bedTimeTextBox" />
        </label>
        <br/>
        <br/>
        <label>End Time:
          <input type="datetime" id="endTimeTextBox" />
        </label>
        <br/>
        <br/>
        <input type="submit" value="Calculate Pay" id="calcPayButton"/>
      </form>
    )
  }

  calculatePay() {
    return 0;
  }
}

export default CalculatePayForm;
